CREATE TABLE address (
    address_id integer NOT NULL,
    location_code character(3) NOT NULL,
    address_type character varying(50) NOT NULL,
    address_other_type_desc character varying(100),
    start_date timestamp without time zone,
    end_date timestamp without time zone,
    district character varying(50),
    sub_district character varying(50),
    suco character varying(100),
    village character varying(100),
    address_status character(1),
    create_date timestamp without time zone,
    create_by character varying(50),
    modify_date timestamp without time zone,
    modify_by character varying(50),
    address_desc character varying(255)
);

